import Row  from 'react-bootstrap/Row'

import UserItem from './UserItem'

const UserList = observer(() => {
    
    return (
        <Row className="d-flex">
            {user.map(user =>
                <UserItem key={user.id} user={user}/>
                )}
        </Row>
    )
})

export default UserList
